import React from 'react';
import { Navbar} from 'react-bootstrap';


//bg="light" expand="lg"
const Header = () => {
    return (
        <Navbar className="header" >
          <Navbar.Brand href="/">Homepage</Navbar.Brand>            
        </Navbar>
    );

};

export default Header;
